import { Link } from "react-router-dom";

export default function EventsPage() {
  const DUMMY_EVENTS = [
    { id: "0", title: "title" },
    { id: "1", title: "title1" },
    { id: "2", title: "title2" },
    { id: "3", title: "title3" },
    { id: "4", title: "title4" },
  ];
  return (
    <>
      <h1>EventsPage</h1>;
      <ul>
        {DUMMY_EVENTS.map((event) => {
          return (
            <li key={event.id}>
              <Link to={event.title}>{event.title}</Link>
            </li>
          );
        })}
      </ul>
    </>
  );
}
